import * as types from "./types";

export const fetchList = (query) => {
    return {
        type: types.FETCH_LIST,
        meta: {
            async: true,
            blocking: true,
            path: `/compositions${query}`,
            method: "GET",
        },
        url: `/compositions${query}`,
    }
};
